import React from 'react'
import {Link, Router} from 'react-router-dom'

const Footer = (props) => {
    return (
        <div className="text-white">
            <Router>
            <Link to="/https://www.youtube.com/results?search_query=/{{props.artist}}/+/{{props.title}}/">Can't find your song?</Link>
            </Router>
        </div>
    )
}

export default Footer
